sys_variable_value.value:
(function execute(inputs, outputs) {
  var resultObj = JSON.parse(inputs.response);
  var errorMsg = '' ;
  var errorCode = '' ;
  var responseBody = new global.JSON().decode(inputs['response']);

   if(inputs.status != '200'){
     outputs.status = "Error";
     outputs = new AzureADErrorHandler().genericErrorHandler(inputs,outputs,responseBody);   
     gs.error("Error While Looking up user id. Error:"+ inputs.errorMessage + " Response Received:" + inputs['response']); 
   }else {
          if(inputs.queryParamsStatus)
              outputs = new AzureADErrorHandler().setNoPropertiesError(inputs,outputs,responseBody);
          else if(resultObj){
             outputs.noOfEntitiesFound = resultObj.value.length.toString();
             outputs = new AzureADUtil().getStatusMessageForLookups(resultObj,outputs,"User");
          }else
              outputs.errorMessage = "Something went wrong. Response was empty";
      }

})(inputs, outputs);

